import { Icon } from "@iconify/react";
import LoggedinContainer from "../containers/Loggedincontainers";
import { useState } from "react";

const Searchpage = () => {
    const[isInputfocused,setInputfocused] = useState(false);
    return (
        <LoggedinContainer currentactivescreen="search">
            <div className="w-full py-6 ">
                <div className="w-1/3 p-3 px-5 text-sm rounded-full bg-gray-900 flex text-white space-x-3 items-center">
                    <div>
                    <Icon icon="zondicons:search" />
                    </div>
                    <input
                    type="text"
                    placeholder="What Do you want to listen?"
                    className="w-full bg-gray-900"
                 />
                 </div>

            </div>
        </LoggedinContainer>
    );
}

export default Searchpage;
